import React, {useEffect} from 'react';
import {Route, Routes} from "react-router-dom";
import Welcome from "./pages/welcome_page/welcome";
import PageNotFound from "./pages/page_not_found/page_not_found";
import Header from "./pages/layout/Header";
import {useDispatch} from "react-redux";
import {useAppDispatch, useAppSelector} from "./hooks/redux";
import {fetch_wares} from "./redux/action_creators/ware_action_creator";
import {login} from "./redux/action_creators/authorization_action_creator";
import Cabinet from "./pages/cabinet/cabinet";
import LoginPage from "./pages/login_page/login_page";

function App() {
    const dispatch = useAppDispatch()
    const {isAuthorized} = useAppSelector(state => state.authorizationReducer)
  return (
    <>
      <Header/>
      <Routes>
        <Route path={"/"} element={<Welcome/>}/>
        <Route path={"/cabinet"} element={isAuthorized ? <Cabinet/> : <LoginPage/>}/>
        <Route path={"*"} element={<PageNotFound/>}/>
      </Routes>
    </>
  );
}

export default App;
